import React from "react";
import { Grid, Box, Typography, Button } from "@material-ui/core";
import WorkOutlineIcon from "@material-ui/icons/WorkOutline";
import CheckCircleIcon from "@material-ui/icons/CheckCircle";

export default function HeaderTask(props) {
  return (
    <>
      <Box className={`box ${props.bgr} py-3`} sx={{ marginTop: "-30px" }}>
        <Box
          sx={{
            display: "flex",
            alignItems: `${props.position}`,
            flexDirection: "column",
            justifyContent: "center" ,
            color: "white",
          }}
        >
          <Button sx={{ color: "white" }}>
            {props.title === "TODOLIST" ? <WorkOutlineIcon /> : null}
            <Typography component="p" variant="subtitle1" sx={{ fontSize: "20px " }} className="ms-2">
              {props.title}
            </Typography>
          </Button>
          <Button><Typography component="p" variant="body2">
            Latest users in 24h
          </Typography></Button>
        </Box>
      </Box>
    </>
  );
}
